    false,nt"url": null,nt"notes": "This annual narrative report for Squaw
    Creek National Wildlife Refuge outlines Refuge accomplishments during the 1965 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    raptors, fish, reptiles, and diseases- is also covered. The Refuge development and
    maintenance section discusses physical developments, plantings, collections and
    receipts, vegetation control, prescribed burning, and wildfires. Resource management
    is outlined; topics include grazing, haying, and fur harvesting. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, violations, and safety. Items of interest, N-R forms, and photographs are
    attached.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
